function draw() {
  ctx.fillStyle = '#fff';
  var x = 0;
  for (var i = 0; i < map.length; i++) {
    var temp = map[i];
    for (var j = 0; j < 10; j++) {
      if (temp[j] === '1') {
        ctx.beginPath();
        ctx.moveTo(x, j*160);
        ctx.lineTo(x+160, j*160);
        ctx.lineTo(x+160, (j+1)*160);
        ctx.lineTo(x, (j+1)*160);
        ctx.closePath();
        ctx.fill();
        // ctx.fillRect(x, j*160, x + 160, (j + 1) * 160);
        console.log(x, j*160, x + 160, (j + 1) * 160);
      }
    }
    console.log('\n');
    x += 160;
  }
}


